import { Link, Redirect } from 'react-router-dom'
import { Helmet } from 'react-helmet';

const OnlineRegistration1 = () => {
    if (localStorage.getItem('access_token') === null){
        return <Redirect to = '/' />
    }
    return ( 
        <div className = 'admissions-officer'>
            <Helmet>
                <title>OnlineRegistration | Fresherstrip</title>
            </Helmet>
            <p id = "steps-info-header">OnlineRegistration</p>

            <div className = 'steps-info'>
                <p>Go to onlineRegistration</p>
            </div>
           
        </div>
    );
}
 
export default OnlineRegistration1;
